uint64_t main_routine(uint64_t inp1, uint64_t inp2, uint64_t* const_list) {
    uint64_t inp = inp2 | (2 * inp1);

    uint64_t len = const_list[0];
    uint64_t result1 = (const_list[1] * inp + const_list[2]);
    uint64_t result2 = (inp * inp) % 0x10001;

    uint64_t i = 0;
    for (i = 0; i < len - 2; i++) {
        result1 = (result1 % 0x10001) + result2 * const_list[3 + i];
        result2 = (result2 * inp) % 0x10001;
    }

    return result1 % 0x10001;
}

uint64_t brute_force(uint64_t res1, uint64_t res2, uint64_t* func_list, uint64_t init) {
    for (uint64_t i = 0; i < 0x100000; i++) {
        uint64_t result = init;
        for (uint64_t j = 0; j < 20; j++) {
            uint64_t tmp = (i >> j) & 1;
            result = main_routine(result, tmp, parsed[func_list[j]]);
        }
        if (result == res1 || result == res2) {
            printf("%ld\n", i);
        }
    }
}

